import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import './fonts/MYRIADPRO-BOLD.woff'
import './fonts/MYRIADPRO-BOLDCOND.woff'
import './fonts/MYRIADPRO-BOLDCONDIT.woff'
import 'src/fonts/MYRIADPRO-BOLDIT.woff'
import 'src/fonts/MYRIADPRO-COND.woff'
import 'src/fonts/MYRIADPRO-CONDIT.woff'
import 'src/fonts/MyriadPro-Light.woff'
import 'src/fonts/MYRIADPRO-REGULAR.woff'
import 'src/fonts/MYRIADPRO-SEMIBOLD.woff'
import 'src/fonts/MYRIADPRO-SEMIBOLDIT.woff'



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
